        // Helper method to show a message box
        private async void ShowMessage(string message)
        {
            var dialog = new MessageDialog(message);
            await dialog.ShowAsync();
        }

        private void MyWebView_ScriptNotify(object sender, NotifyEventArgs e)
        {
            // Get the message sent from JavaScript inside WebView
            string message = e.Value;

            if (message == "buttonClicked")
            {
                // Handle the 'buttonClicked' message from JavaScript
                ResultTextBlock.Text = "Button was clicked inside WebView!";
                ShowMessage("Button clicked inside WebView!");
            }
        }
